Artigo 5º da Constituição da República de 1.988

II - ninguém será obrigado a fazer ou deixar de fazer alguma coisa senão em virtude de lei
IV - é livre a manifestação do pensamento, sendo vedado o anonimato;
XXXIX - não há crime sem lei anterior que o defina, nem pena sem prévia cominação legal;
 LV - aos litigantes, em processo judicial ou administrativo, e aos acusados em geral são assegurados o contraditório e ampla defesa, com os meios e recursos a ela inerentes;
 § 1º As normas definidoras dos direitos e garantias fundamentais têm aplicação imediata.
Art. 53. Os Deputados e Senadores são invioláveis, civil e penalmente, por quaisquer de suas opiniões, palavras e votos.

Um grupo de advogados, do PT de SP, peticionou duas representações, uma no TSE e outra no STF, com intuito de suspender a diplomação deste Deputado e de outros parlamentares. No TSE, o Ministro Alexandre de Moraes negou seguimento e mandou arquivar. Agora, abriu vistas para o PGR se manifestar na mesma representação, com o mesmo teor, no STF. Aguardo com tranquilidade, pois, todos já têm conhecimento que, durante os atos ocorridos, dia 08 dia janeiro, em Brasília, este Deputado estava de férias com a minha família fora do Brasil. Confio na Constituição da República e, em especial, nas cláusulas pétreas.

@josegobboferreira , meu tio me representa. Herói de 64, faço das palavras do senhor  as minhas:

O Tempo dos Eunucos
10/01/2023
Cel. Ref. José Gobbo Ferreira

A Nação está vivendo dias de convulsão. Um Líder deste País repetia que “conhecereis a verdade e ela vos libertará”. E a verdade é que o povo brasileiro não deseja golpes militares. Não deseja este ou aquele político no poder. Não deseja que a Constituição seja ignorada. O povo deseja que todos seus direitos constitucionais sejam respeitados, quer eleições livres, limpas e auditáveis e exige que os candidatos sejam pessoas de bem, honestas, como manda a Lei da Ficha Limpa. O povo só quer que a honestidade e a lei prevaleçam, NADA MAIS.

O STF, porém, colocou-se acima da lei, roubou dos cidadãos direitos constitucionais cristalinos e decidiu que haveria de colocar no poder um presidiário condenado por unanimidade em três instâncias e ainda com vários processos a responder. Para isso retirou arbitrariamente esse apenado da prisão, concedeu-lhe o direito de concorrer à Presidência da República ao arrepio da Lei da Ficha Limpa e fraudou escandalosamente as eleições para que esse criminoso pudesse TOMA-LAS contrariamente à vontade da imensa maioria da população. E se recusa a prestar contas sobre o que, de fato, ocorreu naquele pleito.

Esses, e só esses, são os fatos indiscutíveis geradores desta rebelião. O povo assumiu, com razão, que o governo que USURPOU o poder é ilegítimo e inaceitável. E por isso se rebela.

